import React from 'react';
import { sidebarData } from './sidebarData';

function Sidebar() {
  return (
    <div className="Sidebar">
      <ul className="Sidebarlist">
        {sidebarData.map((val, key) => {
          if (val.title === "Log Out") {
            // We will render Log Out after the map so skip here
            return null;
          }
          return (
            <li key={key} className="row" onClick={() => { window.location.pathname = val.link; }}>
              <div className="icon">{val.icon}</div>
              <div className="title">{val.title}</div>
            </li>
          );
        })}
        {/* Log Out is rendered outside the map to place it at the end */}
        {sidebarData.map((val, key) => {
          if (val.title === "Log Out") {
            return (
              <li key={key} className="row logout" onClick={() => { window.location.pathname = val.link; }}>
                <div className="icon">{val.icon}</div>
                <div className="title">{val.title}</div>
              </li>
            );
          }
        })}
      </ul>
    </div>
  );
}

export default Sidebar;
